    local:
      allowsSignup: false
      enableCaptcha: false
      users:
      - id: "admin"
        name: "andy"
        properties:
        - "consoleUrlProvider"
        - "myView"
        - preferredProvider:
            providerId: "default"
        - theme:
            theme: "noOp"
        - "timezone"
        - "experimentalFlags"
        - mailer:
            emailAddress: "andy.pandaan@outlook.com"
        - "apiToken"
unclassified:
  pipeline-model-docker:
    registry:
      credentialsId: "myDockerID"
      url: "https://index.docker.io/v1/"
  scmGit:
    addGitTagAction: false
    allowSecondFetch: false
    createAccountBasedOnEmail: false
    disableGitToolChooser: false
    globalConfigEmail: "andy.pandaan@outlook.com"
    globalConfigName: "andy pandaan"
    hideCredentials: false
    showEntireCommitSummaryInChanges: false
    useExistingAccountWithSameEmail: false
  sonarGlobalConfiguration:
    buildWrapperEnabled: true
    installations:
    - credentialsId: "sonarqube-id"
      name: "sonarqube-install"
      serverUrl: "http://sonarqube:9000"
      triggers:
        skipScmCause: false
        skipUpstreamCause: false
  sonarQualityGates:
    sonarInstances:
    - maxWaitTime: 0
      name: "sonarqube-quality-gate"
      timeToWait: 0
      url: "http://localhost:9000"
tool:
  dockerTool:
    installations:
    - name: "DockerInstall"
      properties:
      - installSource:
          installers:
          - fromDocker:
              version: "latest"
  git:
    installations:
    - home: "git"
      name: "Default"
  go:
    installations:
    - name: "Go"
      properties:
      - installSource:
          installers:
          - golangInstaller:
              id: "1.23.5"
  mavenGlobalConfig:
    globalSettingsProvider: "standard"
    settingsProvider: "standard"
  nodejs:
    installations:
    - name: "NodeJS"
      properties:
      - installSource:
          installers:
          - nodeJSInstaller:
              id: "23.7.0"
              npmPackagesRefreshHours: 72
          - zip:
              url: "https://nodejs.org/dist/v23.7.0/node-v23.7.0-linux-x64.tar.xz"
  sonarRunnerInstallation:
    installations:
    - name: "SonarQube"
      properties:
      - installSource:
          installers:
          - sonarRunnerInstaller:
              id: "7.0.0.4796"